import React from 'react';
import { Header, Segment } from 'semantic-ui-react';

const SiteHeader = () => (
    <Segment clearing>
        <Header as='h2' floated='right'>
            Charlie Leopard
    </Header>
        <Header as='h2' floated='left'>
            Home
    </Header>
    </Segment>
)


export default SiteHeader;
